regex: 'org.mate.panel.applet.MintMenuAp'
service: 'org.mate.panel.applet.MintMenuAp'
templates:
  Invalid key:
    - 'Qt Warning - invalid keysym: tab'
  Send message:
    - 'sendMessage'
  Critical:
    - 'CRITICAL'
  Error:
    - 'ERROR'
  Warning:
    - 'WARNING'
  Ignore:
    - '\[TimeStamp\]-----main-----begin'
    - 'DEBUG'
    - 'Gtk-Message: GtkDialog mapped without a transient parent. This is discouraged.'